import React from 'react';
import './../App.css' ;
import {makeStyles } from '@material-ui/core';
import {Grid,Paper} from "@material-ui/core";
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';



const useStyles = makeStyles((theme) =>({
  root: {
    flexGrow: 1,
    marginLeft: '270px',
    marginRight:'15px',

  },
  paper: {
    padding: theme.spacing(8),

    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  another:{
    padding: theme.spacing(10),
  },
}));

function Viewdirect () {
  const classes = useStyles();
  const [value, setValue] = React.useState(2);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <div className={classes.root}>
    <Grid container spacing={3}>
          <Grid item xs={4}>
                <Paper className={classes.paper} spacing= {6}>
                <Grid container spacing={3}>
              <Grid item xs={4}>
                <Paper className={classes.paper} spacing= {6}>
                  xs=6
                </Paper>
            </Grid>

            <Grid item xs={8}>
              <Paper className={classes.paper} spacing= {20}>
                xs=6
              </Paper>
            </Grid>
          </Grid>           
          </Paper>
        </Grid>

        <Grid item xs={8}>
          <Paper className={classes.paper, classes.another} spacing= {20}>
                <Tabs
                  value={value}
                  indicatorColor="primary"
                  textColor="primary"
                  onChange={handleChange}
                  aria-label="disabled tabs example"
                >
                  <Tab label="Profile" />
                  <Tab label="Transaction" disabled />
                  <Tab label="Health Report" />
                  <Tab label="Transaction" disabled />

                </Tabs>
          </Paper>
        </Grid>
      </Grid>
      </div>
   
    
  );
}

export default Viewdirect;
